import React, { useEffect, useState } from "react";
import { getTopTagsWithMostDistinctWords } from "../api/auth";
import Button from "../components/Button";
import Input from "../components/Input";

const SearchPagesPage = () => {
  const [tagsData, setTagsData] = useState<Array<{ tag: string; distinct_words_count: number }>>([]);
  const [pageId, setPageId] = useState<string>("");

  useEffect(() => {
    if (pageId) {
      fetchTopTags();
    }
  }, [pageId]);

  const fetchTopTags = async () => {
    try {
      const response = await getTopTagsWithMostDistinctWords(pageId);
      console.log("Resultado:", response.data);
      setTagsData(response.data);
    } catch (error) {
      console.error("Error al obtener los datos:", error);
    }
  };

  return (
    <div className="text-white bg-zinc-900 m-auto h-screen max-w-[800px]">
      <h1 className="text-5xl p-5">Buscar por página</h1>
      <div className="flex p-5">
        <Input
          placeholder="Ingresa el ID de la página..."
          oldText={pageId}
          onChange={setPageId}
        />
        <Button onClick={fetchTopTags}>Buscar</Button>
      </div>

      <h2 className="text-3xl p-5">Top TAGs con más palabras distintas</h2>
      <ul className="p-5">
        {tagsData.length > 0 ? (
          tagsData.map((item, index) => (
            <li key={index}>
              <strong>TAG:</strong> {item.tag}, <strong>Palabras distintas:</strong> {item.distinct_words_count}
            </li>
          ))
        ) : (
          <p>No se encontraron resultados.</p>
        )}
      </ul>

      <Button className="text-2xl" onClick={() => window.history.back()}>Volver a inicio</Button>
    </div>
  );
};

export default SearchPagesPage;
